  const { classes } = props;

  return (
    <React.Fragment>
      <CssBaseline />
      <MuiThemeProvider theme={ytheme}>
      <main>
        {/* Hero unit */}
        <div>
        </div>
        <div>
          {/* End hero unit */}
          <Typography>
              Looks like that's not what you are looking for
          </Typography>
        </div>
      </main>
      {/* Footer */}
      <footer>
      </footer>
      </MuiThemeProvider>
    </React.Fragment>
  );
}

NotFound.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(NotFound);
